import React from "react";
import Map from "./Map";

const WeatherToday = ({
  cityName,
  temp_c,
  text,
  getInfo,
  lat,
  lng,
  country
}) => (
  <>
    <h1>{cityName}</h1>
    <h1>{temp_c}</h1>
    <h1>{text}</h1>
    <div>
      <Map
        getInfo={getInfo}
        lat={lat}
        lng={lng}
        cityName={cityName}
        country={country}
      />
    </div>
  </>
);

export default WeatherToday;
